import React,{useState,useEffect} from 'react';
import Axios from "axios";
import "./Filter.css";

function Filter() {

  const[delivery, setDelivery]=useState("");
  const[takeAway,setTakeAway]=useState("");

  const [restaurants,getRestuarants]=useState([]);

  const[filterVal,setFilterVal]= useState("");

  useEffect(() => {
    getAllRestaurants();
  },[]);

  const getAllRestaurants = () =>{
    Axios.get("http://localhost:3001/RestaurantDisplay")
    .then((response) => {
      const AllRestuarntData=response.data.details;
      getRestuarants(AllRestuarntData);
    })
    .catch(error =>
      console.error(`Error:{error}`));
  }


    return (
        <div className="filter-body">
        <link href="https://maxcdn.bootstrapcdn.com/font-awesome/4.3.0/css/font-awesome.min.css" rel="stylesheet" />
        <div className="container">
        <div className="row">

          <div className="col-md-8">
            <h2 className="grid-title"><i className="fa fa-filter"></i> Filters</h2>
            <hr />

            <h4>Type of delivery:</h4>
            <div class="checkbox">
              <label><input type="checkbox" className="icheck" name="delivery"
              onChange={
                (e) => {
                  setDelivery(e.target.value);
                }
              }/>
              Delivery
              </label>
            </div>
            <div className="checkbox">
              <label><input type="checkbox" className="icheck" name="takeAway"
              onChange={
                (e)=>{
                  setTakeAway(e.target.value);
                }
              }
              />
              Take Away
              </label>
            </div>
            <div className="padding">
            </div>


              <h4>Type of Food:</h4>
            <div className="checkbox">
              <label><input type="checkbox" className="icheck" /> Vegan</label>
            </div>
            <div className="checkbox">
              <label><input type="checkbox" className="icheck" /> Veg</label>
            </div>
            <div class="checkbox">
              <label><input type="checkbox" className="icheck" /> Non Veg</label>
            </div>

            <div className="padding">
            </div>
        </div>
        </div>
        </div>
       </div>
    )
}

export default Filter;
